import { useState, useEffect } from "react";
import axios from 'axios'
import { Navbar, Container, Nav, NavDropdown } from 'react-bootstrap';
import { Link } from 'react-router-dom';

function TabContent(props){
  let cList2 = props.tabContList[props.tab]
  return <Nav className="me-auto">{cList2.map((c)=>{return (<Nav.Link>{c}</Nav.Link>)})}</Nav>
}

function Tab({tabList, tabContList}) {
  let [tab, setTab] = useState(0);
  
  return (
  <div><Nav className="mt-5 mb-3" variant="tabs" defaultActiveKey="link-0">
      {tabList.map((t, idx)=> {
          let k = "link-" + idx;
          return (    
          <Nav.Item>
          <Nav.Link eventKey={k} onClick={()=>{setTab(idx);}}>{t}</Nav.Link>
          </Nav.Item>
          )
      }
      )}
  </Nav>
  <Navbar bg="light" expand="lg">
  <Container>
  <Navbar.Brand href="#home">{tabList[tab]}</Navbar.Brand>
  <Navbar.Toggle aria-controls="basic-navbar-nav" />
    <Navbar.Collapse id="basic-navbar-nav">
  <TabContent tab={tab} tabContList={tabContList}/>
  </Navbar.Collapse></Container></Navbar>
  </div>
  
)
}

